import { useForm } from "react-hook-form";
const Home = () => {
    return(
        <div className="home">
            <h2>Welcome to RTT Forms.</h2>
            <button type="submit">Create New Webform</button>
            <button type="submit">Browse Created Webforms</button>
        </div>
        
    );
}

export default Home
